     &           ptesb_esbtt9t,ptesb_esbtt28t,eqesb_esbtt20c,lt7,av7)

*     8(0): pfesb_esbtt33 tau
*     8(1): pfesb_esbtt62 tau
*     8(2): pfesb_esbtt31 z
      call smffv(lextrn,lextrn,lepinv,exesb_esbtt62o,exesb_esbtt33o,
     &           amlp(3),amlp(3),czll(1,3),cfesb_esbtt62o,
     &           cfesb_esbtt33o,ptesb_esbtt62o,ptesb_esbtt33o,
     &           eqesb_esbtt31c,lt8,av8)

*     9(0): pfesb_esbtt4 electron
*     9(1): pfesb_esbtt17 electron
*     9(2): pfesb_esbtt20 z
      call smffv(lextrn,lextrn,lepinv,exesb_esbtt17m,exesb_esbtt4m,
     &           amlp(1),amlp(1),czll(1,1),cfesb_esbtt17m,cfesb_esbtt4m,
     &           ptesb_esbtt17m,ptesb_esbtt4m,eqesb_esbtt20c,lt9,av9)

      call smconf(lt6,lt7,1,2,exesb_esbtt28t,av6,av7,lt10,av10)
      call smconv(lt8,lt10,3,2,evesb_esbtt31c,av8,av10,lt11,av11)
      call smconv(lt9,lt11,3,5,evesb_esbtt20c,av9,av11,lt,av)

      sym = - 1.0d0
      aprop         = sym/aprop

      indexg(1) = 4
      indexg(2) = 2
      indexg(3) = 6
      indexg(4) = 5
      indexg(5) = 1
      indexg(6) = 3

      call aesb_esbttmpord(lt, av, indexg, agcwrk)

      ancp(jgraph) = 0.0d0
*     nbase = 1
      cwgt = 1.d0
      do 500 ih = 0 , lesb_esbttag-1
         atmp    = cwgt*agcwrk(ih)*aprop
         agc(ih) = agc(ih) + atmp
         ancp(jgraph) = ancp(jgraph) + atmp*conjg(atmp)
  500 continue

      return
      end
